import React from 'react';
import './App.scss';
import { BrowserRouter, Route } from 'react-router-dom';
import Dashboard from './Dashboard';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path="/" exact component={ Dashboard } />
        <Route path="/login" component={ Login } />
      </BrowserRouter>
    </div>
  );
}

export default App;
